                {
                    var timeout = new Timeouter(ReadTimeout);
                    while (InputData.Count < count)
                    {
                        timeout.ThrowIfTimeout();
                    }

                    lock (InputData)
                    {
                        InputData.CopyTo(0, buffer, offset, count);
                        InputData.RemoveRange(0, count);
                    }

                    return count;
                }

